import React from "react";
import {Link} from "react-router-dom";

function Navbar(){
    return(
        <div>
            <link to="/">Produkte</link>
            <link to="/lösungen">Lösungen</link>
            <link to="/tools">Tools</link>
            <link to="/unternehmen"></link>
        </div>
    );
};

export default Navbar;
